import React from "react";
import cars from "../practice.js";

function Table(){
    const [honda, tesla] = cars;
    const [teslaTopColour, teslaBottomColour] = tesla.coloursByPopularity;
    const {teslaTopSpeed, teslaZeroToSixty} = tesla.speedStats;
    const [hondaTopColour, hondaBottomColour] = honda.coloursByPopularity;
    const {hondaTopSpeed, hondaZeroToSixty} = honda.speedStats;

    return (
    <table>
        <tr>
            <th>Brand</th>
            <th>Top Speed</th>
        </tr>
        <tr>
            <td>{tesla.model}</td>
            <td>{teslaTopSpeed}</td>
            <td>{teslaTopColour}</td>
        </tr>
        <tr>
            <td>{honda.model}</td>
            <td>{hondaTopSpeed}</td>
            <td>{hondaTopColour}</td>
        </tr>
    </table>
    );
}

export default Table;
